import {backendLookup} from '../lookup'



export function apiProfileDetail(username, callback){
    backendLookup("GET", `/profiles/${username}/`, callback)
}

export function apiPostAction(postId, action, callback){
    const data = {id: postId, action: action}
    backendLookup("POST", "/posts/action/", callback, data)
}

export function apiProfileFollowToggle(username, callback){
    backendLookup("POST", `/profiles/${username}/`, callback)
}
